// src/components/search/SearchSidebar.jsx
import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import TrendingRecipes from './TrendingRecipes';

const SearchSidebar = ({ isOpen, setIsOpen }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const sidebarRef = useRef(null);
  const navigate = useNavigate();
  
  // Handle click outside to close sidebar
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (sidebarRef.current && !sidebarRef.current.contains(event.target) && isOpen) {
        setIsOpen(false);
      }
    };
    
    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, [isOpen, setIsOpen]);
  
  // Handle search submission
  const handleSearch = (e) => {
    e.preventDefault();
    if (searchTerm.trim()) {
      navigate(`/search?query=${encodeURIComponent(searchTerm)}`);
      setIsOpen(false);
    }
  };

  // Example search suggestions
  const searchSuggestions = [
    "low calorie dinner",
    "quick breakfast",
    "vegetarian lunch",
    "high protein",
    "gluten free dessert"
  ];
  
  return (
    <div 
      ref={sidebarRef}
      className={`fixed top-0 right-0 h-full bg-white shadow-xl z-50 transform transition-transform duration-300 ease-in-out w-80 ${
        isOpen ? 'translate-x-0' : 'translate-x-full'
      }`}
    >
      {/* Search sidebar header */}
      <div className="bg-emerald-700 text-white p-4 flex justify-between items-center">
        <h2 className="text-xl font-semibold">Recipe Search</h2>
        <button 
          onClick={() => setIsOpen(false)}
          className="p-1 hover:bg-emerald-600 rounded-full"
        >
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
          </svg>
        </button>
      </div>
      
      {/* Search form */}
      <form onSubmit={handleSearch} className="p-4 border-b">
        <div className="relative">
          <input
            type="text"
            placeholder="Search recipes (e.g., 'potato, low sugar')"
            className="w-full p-2 pl-10 border rounded-md focus:outline-none focus:ring-2 focus:ring-emerald-500"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
            <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5 text-gray-400" fill="none" viewBox="0 0 24 24" stroke="currentColor">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
            </svg>
          </div>
          <button 
            type="submit"
            className="absolute inset-y-0 right-0 px-3 bg-emerald-600 text-white rounded-r-md hover:bg-emerald-700"
          >
            Search
          </button>
        </div>
      </form>
      
      {/* Search suggestions */}
      <div className="p-4 border-b">
        <h3 className="text-sm text-gray-500 font-medium mb-2">Try searching for:</h3>
        <div className="flex flex-wrap gap-2">
          {searchSuggestions.map((suggestion, index) => (
            <button
              key={index}
              onClick={() => {
                setSearchTerm(suggestion);
                navigate(`/search?query=${encodeURIComponent(suggestion)}`);
                setIsOpen(false);
              }}
              className="px-2 py-1 bg-emerald-50 text-emerald-700 text-sm rounded-full hover:bg-emerald-100"
            >
              {suggestion}
            </button>
          ))}
        </div>
      </div>
      
      {/* Trending recipes section */}
      <div className="p-4">
        <h3 className="text-lg font-medium text-gray-800 mb-4">Trending Recipes</h3>
        <TrendingRecipes setIsOpen={setIsOpen} />
      </div>
    </div>
  );
};

export default SearchSidebar;
